import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import React, { useState } from 'react';
import {
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarNav,
} from 'mdb-react-ui-kit';
import { MDBNavItem, MDBNavLink } from "mdbreact";

/* import Login from "./components/Login"; // make sure the path is correct
import Home from "./components/Home";
import Retrieve from "./components/Retrieve";
import Save from "./components/Save";
import WalletSave from "./components/WalletSave";
 */

function App() {
  return (
      <Router>
        <div>
          <MDBNavbar color="indigo">
            <MDBNavbarBrand>Logo</MDBNavbarBrand>
            <MDBNavbarNav>
              <MDBNavItem>
                <MDBNavLink to="/">Home</MDBNavLink>
              </MDBNavItem>
              <MDBNavItem>
                <MDBNavLink to="/about">About</MDBNavLink>
              </MDBNavItem>
            </MDBNavbarNav>
          </MDBNavbar>
  
          <Switch>
            <Route exact path="/" component={Home} />
            <Route path="/about" component={About} />
          </Switch>
        </div>
      </Router>
    ); 
}

export default App;
